    "\n",
    "#Filtering my data for lower (3,4) and higher (7)  quality only\n",
    "\n",
    "wine_low_quality <- wine_case_study %>%\n",
    "  filter(quality %in% c(3, 4))\n",
    "datatable(wine_low_quality)\n",
    "\n",
    "wine_high_quality <- wine_case_study %>%\n",
    "  filter(quality == 7)\n",
    "\n",
    "datatable(wine_high_quality)\n",
    "\n"
   ]
